import {api, requestConfig} from '../utils/config'

const requestPassword = async(data) => {
    const config = {
        method: "POST",
        body: JSON.stringify(data),
        headers: {
            "Content-Type": "application/json"
        }
    }
}

const passwordService = {
    requestPassword,
}

export default passwordService
